Passport.js Logged out on refresh<p>Having a strange passport.js issue. Only on the production level (works perfectly locally) my users are being logged out if they refresh/change pages. Seems like they are somehow logged out as soon as they log in. So when they go to change pages the isLoggedIn Middleware kicks them out.</p>
<p>Strange issue as it started occurring randomly with no change in the code below for over a year. Help?</p>
<pre><code>// PASSPORT CONFIGURATION
app.use(require(&quot;express-session&quot;)({
secret: &quot;hello&quot;,
cookie: { maxAge: 7500000 },
resave: false,
saveUninitialized: false
}));
app.use(passport.initialize());
app.use(passport.session());
passport.use(new LocalStrategy(User.authenticate()));
passport.serializeUser(User.serializeUser());
passport.deserializeUser(User.deserializeUser());
</code></pre>
<p>======</p>
<pre><code>//IS THE USER LOGGED IN? MIDDLEWARE
function isLoggedin(req, res, next){
if(req.isAuthenticated()){
return next();
}
req.flash(&quot;error&quot;, &quot;Please Login First&quot;);
res.redirect(&quot;/&quot;);
}
</code></pre>

