Mongoose: How to sort aggregate response with two fields<p>I have this mongoose query:</p>
<pre><code> MinutesSpentStudying.aggregate([
    { $match: { connected_user_id: ObjectId(user_id) } },
    {
      $project: {
        minutes_spent_studying: 1,
        year: { $year: &quot;$date&quot; },
        day: { $dayOfMonth: &quot;$date&quot; },
      },
    },
    {
      $group: {
        _id: {
          day: &quot;$day&quot;,
          year: &quot;$year&quot;,
        },
        total_minutes: { $sum: &quot;$minutes_spent_studying&quot; },
      },
    },
    { $sort: { _id: 1 } },
  ]);
</code></pre>
<p>It returns this response:</p>
<pre><code>[
    {
        &quot;_id&quot;: {
            &quot;day&quot;: 2,
            &quot;year&quot;: 2021
        },
        &quot;total_minutes&quot;: 11
    },
    {
        &quot;_id&quot;: {
            &quot;day&quot;: 3,
            &quot;year&quot;: 2021
        },
        &quot;total_minutes&quot;: 1
    },
    {
        &quot;_id&quot;: {
            &quot;day&quot;: 26,
            &quot;year&quot;: 2020
        },
        &quot;total_minutes&quot;: 1
    },
    {
        &quot;_id&quot;: {
            &quot;day&quot;: 27,
            &quot;year&quot;: 2020
        },
        &quot;total_minutes&quot;: 3
    },
]
</code></pre>
<p>I'd like it to sort out by year, and then by day so that it returns the results of 2020 and then the result of 2021.</p>
<p>Any idea how to configure so as to achieve this result?</p>

